import Map from './Map';
import React, { useState } from 'react';
import RestaurantList from "./RestaurantList";


const apikey = '8kY020yd2oSy4ivQKBlxf_a5Bhtizzu0A9deSUakGz8'
// Austurvöllur square in Reykjavik
const userPosition = { lat: 54.9783, lng: -1.6174 }; // Newcastle
const restaurantList = [
    {
        name: "Eldon Square",
        location: { lat: 54.9747, lng: -1.6134 },
    },
    {
        name: "Bæjarins Beztu Pylsur",
        location: { lat: 64.1502, lng: -21.9519 },
    },
    {
        name: "Grillmarkadurinn",
        location: { lat: 64.1475, lng: -21.9347 },
    },
    {
        name: "Kol Restaurant",
        location: { lat: 64.1494, lng: -21.9337 },
    },
];

function App() {
    const [restaurantPosition, setRestaurantPosition] = useState(null);

    const onClickHandler_ = (location) => {
        setRestaurantPosition(location);
    };

    return ( <
            div style = {
            {
                display: 'flex'
            }
        } >
            <
                RestaurantList list = {
                restaurantList
            }
                               onClickHandler = {
                                   onClickHandler_
                               }
            /> <
            Map apikey = {
            apikey
        }
                userPosition = {
                    userPosition
                }
                restaurantPosition = {
                    restaurantPosition
                }
        /> <
        /div>
    );
}



export default App;
